// Client-Side Code
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);
  const sheetId = '78425244'; // Replace with your actual sheet ID

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Create form data using URLSearchParams
        const formData = new URLSearchParams();
        formData.append('sheet_id', sheetId);

        const response = await axios.post(`http://localhost:3001/api/get-records/${sheetId}`, formData, {
          headers: {
            'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8',
          },
        });

        setData(response.data.data);
        console.log(response.data);
      } catch (error) {
        console.error('Error fetching data:', error.message);
      }
    };

    fetchData();
  }, [sheetId]);

  return (
    <div>
      <h1>Tigersheet API Example</h1>
      <ul>
        {Array.isArray(data) && data.length > 0 ? (
          data.map(item => (
            <li key={item.record_id}>
              <p>Username: {item.username}</p>
              <p>Password: {item.password}</p>
              <p>Email: {item.email}</p>
              <hr />
            </li>
          ))
        ) : (
          <p>No data available</p>
        )}
      </ul>
    </div>
  );
};

export default App;
